import React from "react";
import "./style.css";

function Home() {
  return (
    <div>

      <div className="logo">
      <img src="/logo.png" alt="logo" />
      </div>

      <div className="main">
        <div className="feed">

        </div>

        <div className="navbar">
          <div className="nav1"> 
            <p>Endomarketing</p>
            <span>Endomarketing está relacionado à aações de treinamento ou qualificação
              dos colaboradores da empresa visando um melhor serviço para o cliente. Marketing interno,
              devido ao nome, é usualmente confudido com Endomarketing mesmo sendo conceitos diferentes.</span>
              <button>Dispensar</button>
              </div>

          <div className="nav2">navbar2</div>
          </div>
        </div>
    </div >
  );
}

export default Home;
